                    <h2><Link to="/cart" style={{textDecoration:"none",color:"white"}}>Cart</Link></h2>
                </div>
            </div>
        </nav>
      
    {/* <h2 style={{color:"white",textAlign:"center",backgroundColor:"lightskyblue",padding:"10px",margin:"0px"}}>Header Work</h2> */}
    
    
    </>);
}
export default Header;
